import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { SharedModule } from 'app/shared/shared.module';
import { AccordionModule } from 'primeng/accordion';
import { ButtonModule } from 'primeng/button';
import { CalendarModule } from 'primeng/calendar';
import { CardModule } from 'primeng/card';
import { CheckboxModule } from 'primeng/checkbox';
import { DialogModule } from 'primeng/dialog';
import { DividerModule } from 'primeng/divider';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { InputTextModule } from 'primeng/inputtext';
import { InputTextareaModule } from 'primeng/inputtextarea';
import { PanelModule } from 'primeng/panel';
import { SelectButtonModule } from 'primeng/selectbutton';
import { TableModule } from 'primeng/table';
import { TabViewModule } from 'primeng/tabview';
import { ToggleButtonModule } from 'primeng/togglebutton';
import { ConfirmationService } from 'primeng/api';
import { NspConfirmationService } from 'app/shared/confirm/nsp-confirm.service';
import { DynamicDialogModule, DynamicDialogConfig, DynamicDialogRef, DialogService } from 'primeng/dynamicdialog';

import { EnquiryNsmanComponent } from './enquiry-nsman.component';
import { EnquiryNsmanRoutingModule } from './route/enquiry-nsman-routing.module';
import { NsmanParticularSummaryComponent } from './personal-particulars/nsman-particulars-summary.component';
import { NsmanPartialNricSearchComponent } from './search/partial-nric/nsman-partial-nric-search.component';
import { NsmanExpandedParticularsComponent } from './personal-particulars/expanded-particulars/nsman-expanded-particulars.component';
import { NsmanTabsComponent } from './search/nsman-tabs/nsman-tabs.component';
import { NsmanTrainingTabComponent } from './search/nsman-tabs/training-tab/nsman-training-tab.component';
import { NsmanTrainingRecordComponent } from './search/nsman-tabs/training-tab/training-record/nsman-training-record.component';
import { NsmanPaydayTabComponent } from './search/nsman-tabs/payday-tab/nsman-payday-tab.component';
import { NsmanPaydayRecordComponent } from './search/nsman-tabs/payday-tab/payday-record/nsman-payday-record.component';
import { NsmanPrePopulatedEclaimTabComponent } from './search/nsman-tabs/pre-populated-eclaim-tab/nsman-pre-populated-eclaim-tab.component';
import { NsmanIrasConsentHistoryComponent } from './search/nsman-tabs/pre-populated-eclaim-tab/iras-consent-history/nsman-iras-consent-history.component';
import { NsmanEclaimRecordComponent } from './search/nsman-tabs/pre-populated-eclaim-tab/eclaim-record/nsman-eclaim-record.component';
import { NsmanClaimTabComponent } from './search/nsman-tabs/claim-tab/nsman-claim-tab.component';
import { NsmanOverpaymentTabComponent } from './search/nsman-tabs/overpayment-tab/nsman-overpayment-tab.component';
import { NsmanOPInterestComputationComponent } from './search/nsman-tabs/overpayment-tab/interest-computation-pop-up/nsman-op-interest-computation.component';
import { NsmanOPRefundDetailsComponent } from './search/nsman-tabs/overpayment-tab/refund-details/nsman-op-refund-details.component';
import { NsmanPayrollSPBefFy10TabComponent } from './search/nsman-tabs/payroll-sp-bef-fy10-tab/nsman-payroll-sp-bef-fy10-tab.component';
import { NsmanPayrollSPWefFy10TabComponent } from './search/nsman-tabs/payroll-sp-wef-fy10-tab/nsman-payroll-sp-wef-fy10-tab.component';
import { NsmanPayrollKahRnsaTabComponent } from './search/nsman-tabs/payroll-kah-rnsa-tab/nsman-payroll-kah-rnsa-tab.component';
import { NsmanPayrollEventTableComponent } from './search/nsman-tabs/payroll-event-table/nsman-payroll-event-table.component';
import { NsmanIncrementHistoryComponent } from './search/nsman-tabs/payroll-sp-wef-fy10-tab/nsman-increment-history/nsman-increment-history.component';
import { NsmanIncrementTagComponent } from './search/nsman-tabs/payroll-sp-wef-fy10-tab/nsman-increment-tag/nsman-increment-tag.component';
import { NsmanSpecialIncrementComponent } from './search/nsman-tabs/payroll-sp-wef-fy10-tab/nsman-special-increment/nsman-special-increment.component';
import { NsmanInitialRankPayComponent } from './search/nsman-tabs/payroll-sp-wef-fy10-tab/nsman-initial-rank-pay/nsman-initial-rank-pay.component';
import { NsmanSupportingDocumentTabComponent } from './search/nsman-tabs/supporting-document-tab/nsman-supporting-document-tab.component';
import { NsmanCpfIrasTabComponent } from './search/nsman-tabs/cpf-iras-tab/nsman-cpf-iras-tab.component';
import { NsmanLetterTabComponent } from './search/nsman-tabs/letter-tab/nsman-letter-tab.component';
import { NsmanTaxTabComponent } from './search/nsman-tabs/tax-tab/nsman-tax-tab.component';
import { CABModule } from '../caution-alert-block/cab.module';

@NgModule({
  declarations: [
    EnquiryNsmanComponent,
    NsmanParticularSummaryComponent,
    NsmanPartialNricSearchComponent,
    NsmanExpandedParticularsComponent,
    NsmanTabsComponent,
    NsmanTrainingTabComponent,
    NsmanTrainingRecordComponent,
    NsmanPaydayTabComponent,
    NsmanPaydayRecordComponent,
    NsmanPrePopulatedEclaimTabComponent,
    NsmanIrasConsentHistoryComponent,
    NsmanEclaimRecordComponent,
    NsmanClaimTabComponent,
    NsmanOverpaymentTabComponent,
    NsmanOPInterestComputationComponent,
    NsmanOPRefundDetailsComponent,
    NsmanPayrollSPBefFy10TabComponent,
    NsmanPayrollSPWefFy10TabComponent,
    NsmanPayrollKahRnsaTabComponent,
    NsmanPayrollEventTableComponent,
    NsmanIncrementHistoryComponent,
    NsmanIncrementTagComponent,
    NsmanSpecialIncrementComponent,
    NsmanInitialRankPayComponent,
    NsmanSupportingDocumentTabComponent,
    NsmanCpfIrasTabComponent,
    NsmanLetterTabComponent,
    NsmanTaxTabComponent,
  ],
  imports: [
    CommonModule,
    SharedModule,
    AccordionModule,
    ButtonModule,
    CalendarModule,
    CardModule,
    CheckboxModule,
    DialogModule,
    DynamicDialogModule,
    DividerModule,
    FormsModule,
    InputTextModule,
    InputTextareaModule,
    PanelModule,
    ReactiveFormsModule,
    SelectButtonModule,
    TableModule,
    TabViewModule,
    ToggleButtonModule,
    EnquiryNsmanRoutingModule,
    CABModule,
  ],
  exports: [],
  providers: [
    DialogService,
    DynamicDialogRef,
    DynamicDialogConfig,
    ConfirmationService,
    NspConfirmationService,
  ]
})

export class EnquiryNsmanModule {}
